import React from 'react';
import customData from '../books.json';

const books = () => {
console.log(customData);
    return (
        <div>
           <h1>BoekenLijst</h1>

         <div>
             <h2>{customData.books.book1.title}</h2>
             <p>{customData.books.book1.Auteur}</p>
             <p>{customData.books.book1.Jaar}</p>
             <p>{customData.books.book1.Prjs}</p>
         </div>

         <div>
             <h2>{customData.books.book2.title}</h2>
             <p>{customData.books.book2.Auteur}</p>
             <p>{customData.books.book2.Jaar}</p>
             <p>{customData.books.book2.Prjs}</p>
         </div>

         <div>
             <h2>{customData.books.book3.title}</h2>
             <p>{customData.books.book3.Auteur}</p>
             <p>{customData.books.book3.Jaar}</p>
             <p>{customData.books.book3.Prjs}</p>
         </div>

        </div>
    );
};

export default books;
